    data: |
      SELECT DISTINCT - 10 + - col1 + - col0 - + 53 + - + col1 * col0 / col0 AS col0, col1 * ( + 21 ) col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q12688.out
    data: |
      -162	21
      -192	441
      -240	1701
